fun morganAndString(a: String, b: String): String {
    val builder = StringBuilder()

    var i = 0
    var j = 0

    while (i < a.length && j < b.length) {
        if (a[i] <= b[j]) {
            builder.append(a[i])
            i++
        } else {
            builder.append(b[j])
            j++
        }
    }

    while (i < a.length) {
        builder.append(a[i])
        i++
    }

    while (j < b.length) {
        builder.append(b[j])
        j++
    }

    return builder.toString()
}

fun main(args: Array<String>) {
    val t = 2
    arrayOf(
        arrayOf("ACA", "BCF"),
        arrayOf(
            "JACK",
            "DANIEL"
        ),
        arrayOf(
            "ABACABA",
            "ABACABA"
        ),
        arrayOf(
            "",
            ""
        )
    ).forEach { println(morganAndString(it[0], it[1])) }
}
